    height: 0%;
    background-color: #fff;
    position: absolute;
    bottom: 0;
    left: 0;
    transition: .5s;
    z-index: 20;
}

.sns_wrap .sns_box::before {
    content: "";
    display: block;
    width: 0%;
    height: 10px;
    background-color: #fff;
    position: absolute;
    bottom: 0;
    left: 0;
    transition: .5s;
    z-index: 20;
}

.sns_wrap .sns_box:hover::after {
    height: 100%;
}

.sns_wrap .sns_box:hover::before {
    width: 100%;
}

