    /* line-height: 0px; */
   
}

.sns_wrap .sns_box .sns_desc::after {
    content: '';
    width: 10px;
    height: 0%;
    display: block;
    background-color: #fff;
    position: absolute;
    right: 0;
    top: 0;
    transition: .5s;
}

.sns_wrap .sns_box .sns_desc::before {
    content: '';
    width: 0%;
    height: 10px;
    display: block;
    background-color: #fff;
    position: absolute;
    right: 0;
    top: 0;
    transition: .5s;
}

.sns_wrap .sns_box:hover .sns_desc::after {
    height: 100%;
}

.sns_wrap .sns_box:hover .sns_desc::before {
    width: 100%;
}

.sns_wrap .sns_box:hover .sns_desc {
    opacity: 1;
}


