/**********magazine section*************/

.magazine_section {
    width: 100%;
    margin-top: 200px;
    /* height: 800px; */
    overflow: hidden;


}

.magazine_section h1 {
    text-align: center;
    margin-bottom: 50px;
    font-size: 28px;
}

.magazine_section .magazine_wrap {
    display: flex;
    width: 100%;
}

.magazine_section .magazine_wrap .mgz_box {
    font-size: 0;
    width: calc(100% - 75% -40px);
    margin-left: 40px;
    /* position: relative; */
}

.magazine_section .magazine_wrap .mgz-cont {
    position: relative;
}

.magazine_section .magazine_wrap .mgz_box:nth-child(4) {
    margin-right: 40px;
}

.magazine_section .magazine_wrap .mgz_box img {
    width: 100%;
    height: auto;
    transition: .3s;

}

.magazine_section .magazine_wrap .mgz_box .mgz_desc {
    position: absolute;
    top: 0;
    left: 0;
    background-color: rgba(0, 0, 0, 0.5);
    z-index: 10;
    width: 100%;
    height: 100%;
    opacity: 0;
    transition: .3s;
}

.magazine_section .magazine_wrap .mgz_box .mgz_desc h4 {
    font-size: 20px;
    position: absolute;
    top: -10%;
    left: 0;
    /* transform: translateX(-50%); */
    width: 100%;
    text-align: center;
    color: #fff;
    transition: .3s;

}

.magazine_section .magazine_wrap .mgz_box .mgz_desc p {
    font-size: 16px;
    position: absolute;
    bottom: -10%;
    left: 0;
    /* transform: translateX(-50%); */
    width: 100%;
    text-align: center;
    color: #fff;
    transition: .3s;
    line-height: 30px;
}

.magazine_section .magazine_wrap .mgz_box .mgz_tit {
    font-size: 22px;
    font-weight: bold;
    text-align: center;
    margin-top: 10px;
}
.magazine_section .magazine_wrap .mgz_box:hover img{
    box-shadow: 0 0 20px black;
}
.magazine_section .magazine_wrap .mgz_box:hover .mgz_desc h4 {
    top: 10%;
}

.magazine_section .magazine_wrap .mgz_box:hover .mgz_desc p {
    bottom: 10%;
}

.magazine_section .magazine_wrap .mgz_box:hover .mgz_desc {
    opacity: 1;
}

.mgz01{
    transition-delay: 0;
    transform: translateX(-500px);
}
.mgz02{
    transform: translateX(-1000px);
}
.mgz03{
    transform: translateX(-1500px);
}
.mgz04{
    transform: translateX(-2000px);
}



